import React, { useState } from "react";

const api = {
  key: "X1-ZWz1hiqiaku2ob_1pt0f",
  baseUrl:
    "http://www.zillow.com/webservice/http://www.zillow.com/webservice/GetSearchResults.htm/",
};
function Zillow() {
  const [query, setQuery] = useState("");
  const [searchResult, setSearchResult] = useState({});

  const search = (e) => {
    if (e.key === "Enter") {
      fetch(`${api.baseUrl}searchResult?q=${query}&APPID=${api.key}`)
        .then((res) => res.json())
        .then((result) => {
          setSearchResult(result);
          setQuery("");
          console.log(result);
        });
    }
  };
  return (
    <main>
      <div>
        <input
          type="text"
          placeholder="Search..."
          onChange={(e) => setQuery(e.target.value)}
          value={query}
          onKeyPress={search}
        />
      </div>
      {typeof searchResult.properties !== "undefined" ? (
        <div>{searchResult.address}</div>
      ) : (
        ""
      )}
    </main>
  );
}

export default Zillow;
